import React from 'react';

import Header from './Header';
import Footer from './Footer';
import Subscribe from './Subscribe';
import ContactSection from './ContactSection';
// Header Component

// PageTitle Component
const PageTitle = () => (
  <section className="page-title centred pt_110">
    <div className="auto-container">
      <div className="content-box">
        <h1>Contact us</h1>

      </div>
    </div>
  </section>
);






// GoogleMap Component
const GoogleMap = () => (
    <section className="google-map pb_80">
      <div className="auto-container">
        <div className="inner-container">
          <iframe
            src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d7617.009439024707!2d78.3745698!3d17.4367038!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3bcb91005a8f956b%3A0xe52dbe451cf10df5!2sDoctors%20Colony%2C%20Hyderabad%2C%20Telangana!5e0!3m2!1sen!2sin!4v1694932800000!5m2!1sen!2sin"
            width="100%"
            height="500"
            frameBorder="0"
            style={{ border: 0, width: '100%' }}
            allowFullScreen=""
            aria-hidden="false"
            tabIndex="0"
          ></iframe>
        </div>
      </div>
    </section>
  );








// Main ContactPage Component
const ContactPage = () => {
  return (
    <div className="boxed_wrapper ltr">
      <Header />
      <PageTitle />
      <ContactSection />
      <GoogleMap />
      <Subscribe/>
      <Footer />
      <div className="scroll-to-top">
        <svg className="scroll-top-inner" viewBox="-1 -1 102 102">
          <path d="M50,1 a49,49 0 0,1 0,98 a49,49 0 0,1 0,-98" />
        </svg>
      </div>
    </div>
  );
};

export default ContactPage;
